export default function (...params) {
    console.log(...params);
    const API = params[1];

    let data = "?";

    if (params[1]) {
        for (let key in params[1]) {
            data = `${data}${key}=${params[1][key]}&`;
        }
    }

    //console.log(`${API}${data}`);
    return fetch(`${API}${data}`, {
        method:'POST',
        mode: 'no-cors',
        headers:{
            'Access-Control-Allow-Origin':'*'
        }
    });
}
